import React from 'react';
import './LoggedInNavbar.css';

const LoggedInNavbar = () => {
    return (
        <nav className="logged-in-navbar">
            <div className="logo">
                <h1>Cinema Movies</h1>
            </div>
        </nav>
    );
};

export default LoggedInNavbar;
